import React from "react";
import { useState, useEffect } from "react";
import axios from "axios";

function Codeforces() {
  const [handle, sethandle] = useState("Hustlingbeast_Anish");
  const [users, setusers] = useState([]);

  const fetchdetails = () => {
    axios
      .get(`https://codeforces.com/api/user.info?handles=${handle}`)
      .then((res) => {
        setusers(res.data.result);
        console.log(res.data.result);
      })
      .catch((e) => {
        console.log(e);
      });
  };
  return (
    <>
      fetchdetails();
      <input
        // type="text"
        placeholder="Enter Your Codeforces Id"
        onChange={(e) => {
          sethandle(e.target.value);
        }}
      />
      <button onClick={fetchdetails}>Find</button>
      <div class="card" style={{ width: "18rem" }}>
        <img src={users[0].titlePhoto} class="card-img-top" alt="..." />
        <div class="card-body">
          <p class="card-text">
            Some quick example text to build on the card title and make up the
            bulk of the card's content.
          </p>
        </div>
      </div>
      <h2>Maximum Rating {users[0].maxRating}</h2>
    </>
  );
}

export default Codeforces;
